import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "../css/navbar.css"; // Optional: your styles

function Navbar({ isAuthenticated }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear session cookie or localStorage if needed
    // For now, simulate logout
    localStorage.removeItem("token"); // if you're using token
    navigate("/login");
    window.location.reload(); // Refresh to reset auth state (optional)
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <Link to="/">CarWash</Link>
      </div>

      <ul className="navbar-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/booking">Book</Link></li>
        <li><Link to="/my-bookings">My Bookings</Link></li>
        <li><Link to="/profile">Profile</Link></li>

        {!isAuthenticated ? (
          <>
            <li><Link to="/login">Login</Link></li>
            <li><Link to="/register">Register</Link></li>
          </>
        ) : (
          <li><button className="logout-button" onClick={handleLogout}>Logout</button></li>
        )}
      </ul>
    </nav>
  );
}

export default Navbar;
